import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Table from './Table';
import Row from './Row';
import RowList from './RowList';
import * as serviceWorker from './serviceWorker';

const transactions = [
  {
     id: 1,
     date: '06/28/2019',
     desc: 'POS PURCHASE          POS61007500  1124221 GIANT-EAGLE #0           PITTSBURGH   PA',
     outflow: 18.01,
     inflow: 0.00
  },
  {
      id: 2,
      date: '06/28/2019',
      desc: 'DEBIT CARD PURCHASE   XXXXX6868 PPAP FIRST AVENUE 212     PITTSBURGH  PA',
     outflow: 12.00,
     inflow: 0.00
  },
  {
     id: 3,
     date: '06/29/2019',
     desc: 'ACH CREDIT      XXXXX5139R32 GRANT STREET GRO DIRECT DEP',
     outflow: 0.00,
     inflow: 2106.62
  }
 ];


ReactDOM.render(
  <RowList transactions={transactions}/>,
  document.getElementById('root')
);

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
